import React from "react";
import "./selectmenu.css";

const SelectionMenu = ()=> {
    return (
        <div className="select-box">
            <div className="select-option">
                <input type="text" placeholder="Select" id="soValue" readOnly name=""></input>
            </div>
            <div className="content">
                <div className="search">
                    <input type="text" id="optionSearch" placeholder="Search" name=""></input>
                </div>
                <ul className="options">
                    <li>HTML</li>
                    <li>CSS</li>
                    <li>REACT</li>
                    <li>PHP</li>
                </ul>
            </div>
        </div>
    );
}

export default SelectionMenu
